import PageTop from "../../../../../common/components/topPageTitle/Index";
import { BsArrowLeft } from "react-icons/bs";
import Checkbox from "@mui/material/Checkbox";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormGroup from "@mui/material/FormGroup";
import { useState } from "react";

import { RightFilters } from "../../../../../common/components/RightFilters/RightFilters";
export const Notes = () => {
  return (
    <>
      <div className="custom_container">
        <div>
          <PageTop TitleLink={-1} TilelIcon={<BsArrowLeft />} Name="Notes" />
        </div>
        <RightFilters
          title="Filter"
          btn1="Reset"
          btn2="Show results"
          data={<ProjectsRightFiltersData />}
        />
      </div>
    </>
  );
};
export const ProjectsRightFiltersData = () => {
  const [FiltersAdd, setFiltersAdd] = useState(false);
  const FiltersAddOpen = () => {
    setFiltersAdd(!FiltersAdd);
  };
  const Data = [
    {
      toptile: "Sort By",
      cat1: [
        {
          label: "Most recent",
        },
        {
          label: "Most relevent",
        },
      ],
    },
    {
      toptile: "Priority",
      cat1: [
        {
          label: "High",
        },
        {
          label: "Medium",
        },
        {
          label: "Low",
        },
      ],
    },
    {
      toptile: "Department",
      cat1: [
        {
          label: "My role only",
        },
        {
          label: "Design",
        },
        {
          label: "Developement",
        },
        {
          label: "Marketing",
        },
        {
          label: "Others",
        },
      ],
    },
    {
      toptile: "Status",
      cat1: [
        {
          label: "Assigned",
        },
        {
          label: "In progress",
        },
        {
          label: "In review",
        },
        {
          label: "Not started",
        },
        {
          label: "Pending",
        },
        {
          label: "Delayed",
        },
        {
          label: "Completed",
        },
      ],
    },
    {
      toptile: "Status",
      cat1: [
        {
          label: "Assigned",
        },
        {
          label: "In progress",
        },
        {
          label: "In review",
        },
        {
          label: "Not started",
        },
        {
          label: "Pending",
        },
        {
          label: "Delayed",
        },
        {
          label: "Completed",
        },
      ],
    },
  ];
  const App = (props) => {
    return (
      <>
        <div className="row Projects_Right_Filters_Data_main_div">
          <div className="col-12">
            <p>{props.toptile}</p>
          </div>
          {props.arr.cat1.map((val, i) => {
            return (
              <div
                key={i}
                className="col-xxl-6 col-xl-6 col-lg-6 col-md-6 col-sm-12 col-12"
              >
                <FormGroup>
                  <FormControlLabel control={<Checkbox />} label={val.label} />
                </FormGroup>
              </div>
            );
          })}
        </div>
      </>
    );
  };
  const FiltersInnerBtn = () => {
    return (
      <>
        <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
          <div className="col-6">
            {/* <AboutProfileInput
              label="Start Date"
              type="date"
              className="form-control"
              placeholder="918-233-2345"
            /> */}
          </div>
          <div className="col-6">
            {/* <AboutProfileInput
              label="End Date"
              type="date"
              className="form-control"
              placeholder="918-233-2345"
            /> */}
          </div>
          <div className="col-12 text-center">
            <div className={`${FiltersAdd ? "d-block" : "d-none"}`}>
              <button
                className="UploadDocumentModal_body_btn2 w-75"
                onClick={FiltersAddOpen}
              >
                Add
              </button>
            </div>
          </div>
        </div>
      </>
    );
  };
  return (
    <>
      {Data.map((val, i) => {
        return <App key={i} toptile={val.toptile} arr={val} />;
      })}
      <div className={`${FiltersAdd ? "d-none" : "d-block"}`}>
        <button
          className="UploadDocumentModal_body_btn2"
          onClick={FiltersAddOpen}
        >
          Custom
        </button>
      </div>
      <div>{FiltersAdd ? <FiltersInnerBtn /> : null}</div>
    </>
  );
};
